import React from 'react'

const StackBtn = (props)=> {

    switch (props.name.toLowerCase()) {
        case "node":
            props.name = "nodejs"
            break;
        default:
            break;
    }

    return (
      <div className={`stack-btn stack-${props.name.toLowerCase()} mr-2 mb-1`}>
        <i class={`devicon-${props.name.toLowerCase()}-plain`}></i>
      </div>
    );
}

export default StackBtn
